`,r.jsx(e.h2,{children:"Usage Scenario"}),`
`,r.jsx(e.p,{children:'This project can be used in any nonlinear, narrative-heavy game. For an example game, the player assumes the role of a character navigating a psychologically charged, narrative-rich environment, where decision-making and consequence form the backbone of both progression and thematic expression. Rather than relying on traditional save/load systems as external utilities, this game recontextualizes those actions as diegetic mechanics -- systems that exist within the game world and carry narrative weight. A player might, for instance, choose to revisit a previous moment not to "retry" an outcome in the traditional sense, but to interrogate the meaning of their past decisions, with the game recognizing not only the altered choice but the act of returning itself. This leads to new world states, emergent character reactions, and evolving narrative arcs. The system supports a branching structure of narrative causality informed by both temporal behavior and choice context, enabling a player experience where reflection, repetition, and persistence are not only supported, but thematically and mechanically incentivized. The core innovations are intended as both a proof of concept and design investigation into integrating narrative consequence with player-driven temporal systems, suitable for applications in story-driven games where player agency is framed as more than linear progression.'}),`
