`,r.jsx(e.p,{children:"The prototype will be delivered as a standalone executable with a supplementary README file containing run instructions and build notes. It will boot directly into the playable segment and include:"}),`
`,r.jsxs(e.ul,{children:[`
`,r.jsx(e.li,{children:"A narrative introduction scene to establish tone and input vocabulary."}),`
