`,r.jsxs(e.p,{children:[r.jsx(e.em,{children:"Ganymede"})," is a first-person spell-based capture-the-flag prototype, built in Unreal Engine 5 for networked multiplayer with AI-controlled bots. The design focus was on tactical utility and battlefield control over pure mechanical aiming."]}),`
`,r.jsx(e.p,{children:"The first version was made entirely in Blueprint for speed of iteration. The second iteration was rebuilt in C++ and the Gameplay Ability System (GAS) to support improved networking, modularity, and performance."}),`
`,r.jsx(e.h2,{children:"The Challenge"}),`
`,r.jsx(e.p,{children:'I wanted to test how FPS design changes when direct-damage weapons are de-emphasized in favor of abilities that manipulate space, timing, and information. Capture-the-flag provides a natural structure for that -- it forces teamwork, creates evolving objectives, and gives bots a reason to coordinate beyond just "shoot the enemy."'}),`
`,r.jsx(e.p,{children:"On the technical side, I challenged myself to:"}),`
`,r.jsxs(e.ul,{children:[`
`,r.jsx(e.li,{children:"Build a modular ability system that designers could extend without rewriting core code."}),`
`,r.jsx(e.li,{children:"Create AI bots capable of basic CTF play: grabbing the flag, escorting, defending, and opportunistically engaging enemies."}),`
`,r.jsx(e.li,{children:"Support multiplayer replication in a way that felt responsive despite the complexity of abilities."}),`
`,r.jsx(e.li,{children:"Exercise my less-developed abilities in level design."}),`
`]}),`
`,r.jsx(e.h2,{children:"Development Process"}),`
`,r.jsx(e.h3,{children:"Early Prototyping"}),`
`,r.jsx(e.p,{children:'The earliest prototypes were quick Blueprint experiments -- simple projectile abilities, rough maps, and placeholder AI logic. This phase was less about polish and more about proving that "spells instead of guns" could support real FPS flow.'}),`
